import '../css/Header.css'
import React, { Component } from 'react';

class NavigationUnit{
  constructor(title, subMenu){
    this.title = title;
    this.subMenu = subMenu;
  }
}

var HeaderContent = [new NavigationUnit("Dashboard",null), new NavigationUnit("Wallets",null)];

class Header extends React.Component{
  constructor(props){
    super(props);
    props.changeState(HeaderContent[0].title);
  }

  render(){
    return (
      <header>
      {HeaderContent.map((unit) => (<div onClick={this.props.changeState(unit.title)} key={unit.title} className="navUnit">{unit.title}</div>))}
      </header>
    );
  }
};
export default Header;
